        this.state={activeTab:0}
    }
    render() {
        return (
            <div className="category-tabs">

                <Tabs activeTab={this.state.activeTab} onChange={(tabId)=>this.setState({activeTab:tab})  }>

                </Tabs>
            </div>
        )
    }

}
export default Project;
